And I mean THE WHOLE GRAIN 🌾, no flour, no egg, no oil, no milk, no additives or processed elements, as natural as they can possibly be. 

I have been carrying around this idea for a while now, to transform my usual breakfast bowl into a pancake. Mostly to make breakfast even more special on the weekends. This is the first try, and I would say it worked. My taste buds sparkled. 

After cooking my usual whole grains 🌾 in water, I reduced the water more to bring the mix to a more firm texture. Then I added a mix of water, ground flax and chia seeds (egg replacer) and some diced banana. That’s it. The texture of the mix should be rather firm, almost as if you can knit it in your hands now. Take a baking tray and shape the whole grain mix to small pancakes. They won’t rise or anything, the keep exactly that shape you make. Put the oven to 180 degrees and let them bake for 60min. Flip them halfway through. 

But the real stars ✨ ⭐️ are the fruits on the plate. I added some of my cinnamon roasted pineapple 🍍bits, fresh blueberries, quarter of a banana 🍌 , and a delicious apple cream, which I make from steamed apples 🍎 and cashews. Oh boy! With so much sweet deliciousness on the plate there is not need for extra maple syrup. 
